import Link from 'next/link'

import styles from './menu.module.scss'

const Header = () => (
     <header className={styles.HeaderContainer}>
         <div>A</div>
         <div>B</div>
         <div>C</div>
         <div>D</div>
         <div>E</div>
         <div>F</div>
         <div>G</div>
         <div>H</div>
         <div>I</div>
         <div>J</div>
         <div>
             {/* LOGO */}
             <Link href="/" as={`/`}>
                 <h1 className={styles.H1Container}>Yum Tash</h1>
            </Link></div>
         <div>L</div>
         <div>M</div>
         <div>N</div>
         <div>P</div>
         <div>Q</div>
         <div>R</div>
         <div>S</div>
         <div>T</div>
         <div>U</div>
         <div>V</div>
         <div>W</div>
         <div>1</div>
         <div>2</div>
         <div>3</div>
         <div>4</div>
         <div>5</div>
         <div>6</div>

     </header>
);

export default Header


